angelu[m] dei forte[m] uolan{tem per}
mediu[m] celu[m] uoce ma{gna}
clama[n]te[m] et dicente[m]
Veniens a libano q{uam}

[Leaf from a liturgical manuscript, probably an antiphonary, containing text and music for the responsory (&quot;Audivi vocem in caelo Angelorum multorum dicentium&quot;) and verse (&quot;Vidi angelum Dei fortem volantem&quot;) following the fifth reading and the responsory (&quot;Veniens a Libano quam pulchra facta est, alleluia&quot;) following the sixth reading for matins of the Divine Office for the third Sunday after Easter. Neumes and 4-line staves in brown ink (DO line highlighted in red ink). Text in a Gothic bookhand in brown ink; rubric in red. Two large initials, one in blue with red penwork extensions and one in red with blue penwork extensions.]

Penn Libraries call number: LatC P6989.3 1521

